import React, { useState, useEffect } from 'react';
import '../css/MyBookings.css'; // Custom CSS for mobile responsiveness

export default function MyBookings() {
  const [bookings, setBookings] = useState([]);

  // Fetching user bookings (assuming a GET request to fetch bookings from the backend)
  useEffect(() => {
    fetch('http://localhost:5000/booking/user-bookings', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
      },
    })
      .then((response) => response.json())
      .then((data) => setBookings(data))
      .catch((error) => {
        console.error('Error fetching bookings:', error);
      });
  }, []);

  return (
    <div className="my-bookings-container">
      <h2>My Bookings</h2>
      {bookings.length > 0 ? (
        bookings.map((booking) => (
          <div className="booking-card" key={booking.bookingId}>
            <div className="booking-info">
              <h4>{booking.service}</h4>
              <p>{`Date: ${booking.date} | Time: ${booking.timeSlot}`}</p>
              <p>{`Total: $${booking.total}`}</p>
              <div className={`status ${booking.status.toLowerCase()}`}>
                {booking.status}
              </div>
            </div>
          </div>
        ))
      ) : (
        <p>No bookings yet.</p>
      )}
    </div>
  );
}
